import Resource from "./Resource";
import $ from "jquery";

function ResourceUsageBar() {
    return (

        <div id="resource-usage-bar">
          {
            $.ajax({url: "http://localhost:4000/cpuUsage", success: function(result){
              console.log(result)
            }})
          }
            <Resource 
            imgPath={"#"}
            usageMetric={"2%"}
            resourceName={"CPU"}
          />
    
          <Resource 
            imgPath={"#"}
            usageMetric={"13%"}
            resourceName={"MEM"}
          />
    
          <Resource 
            imgPath={"#"}
            usageMetric={"20GB"}
            resourceName={"Free"}
          />
        </div>

    );
}

export default ResourceUsageBar;
